(2, 'Lĩnh vực hoạt động', 'linh-vuc-hoat-dong', '', 15, 'vietnamese', '[\"15\"]', '/uploads/images/bai-viet/japan-840x500-20.jpg', '\"\"', '<p>Chào mừng quý khách hàng đến với website của Nhũ Tương Puma Kính thưa quý khách hàng Công ty cổ phần Nhũ Tương Puma Việt Nam với kinh nghiệm 10 năm trong lĩnh vực sản xuất vật liệu cho các công trình xây dựng.</p>', '<header class=\"the-article-header\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 0px -300px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; float: left; width: 600px; text-align: center; position: relative; clear: both; left: 550px; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">\r\n<h1 class=\"the-article-title cms-title\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 2rem; vertical-align: baseline; background: transparent; text-size-adjust: 100%; font-family: &quot;Noto Serif&quot;, serif; color: rgb(17, 17, 17); -webkit-font-smoothing: antialiased; font-style: italic; letter-spacing: -1px !important;\">&nbsp;</h1>\r\n</header>\r\n\r\n<div class=\"the-article-body cms-body\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 0px -400px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; float: left; width: 800px; position: relative; font-family: &quot;Noto Serif&quot;, serif; color: rgb(34, 34, 34); line-height: 28px; -webkit-font-smoothing: antialiased; clear: both; left: 550px;\">\r\n<table align=\"center\" class=\"picture\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 20px 0px 30px -60px; padding: 0px; border: 0px; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: