height: 46px; text-align: center; -webkit-font-smoothing: antialiased; position: relative;\"><span class=\"counter\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 1px 0px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; background: rgb(30, 175, 139); text-size-adjust: 100%; display: block; width: 43px; height: 24px; font-weight: bold; color: rgb(255, 255, 255); line-height: 24px; -webkit-font-smoothing: antialiased;\">2</span></li>\r\n</ul>\r\n\r\n<p class=\"the-article-summary cms-desc\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 14px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; font-family: &quot;Noto Serif&quot;, serif; font-weight: bold; color: rgb(34, 34, 34); line-height: 30px; -webkit-font-smoothing: antialiased; clear: both; float: left; width: 660px;\">&nbsp;Sau sự xuất hiện đầy cuốn hút của nữ chính trong MV \"Lạc trôi\", dân mạng hiện tìm kiếm những cô gái từng trở thành một cặp với Sơn Tùng M-TP.</p>\r\n\r\n<div class=\"the-article-body cms-body\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; float: left; width: 660px; position: relative; font-family: &quot;Noto Serif&quot;, serif; color: rgb(34, 34, 34); line-height: 30px; -webkit-font-smoothing: antialiased;\">\r\n<table align=\"center\" class=\"video\" style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 14px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; text-size-adjust: 100%; border-collapse: collapse; border-spacing: 0px; width: 660px; float: none;\">\r\n	<tbody style=\"box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px; padding: 0px; border: 0