cu-gamuda.jpg 980w, http://gamudacity.info/wp-content/uploads/2016/06/thiet-ke-chung-cu-gamuda-300x153.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"800\" /></p>\r\n\r\n<h2 style=\"box-sizing: border-box; font-family: &quot;Segoe UI&quot;, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; line-height: 1.3636; margin: 10px 0px; font-size: 20px; text-align: justify;\"><span style=\"box-sizing: inherit; font-weight: 700; color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px;\">HOTLINE<em style=\"box-sizing: inherit;\">&nbsp;☎ &nbsp;</em></span>0936.130.538</h2>', 'Phong cách Đông Dương', 'null', 'null', 0, 76, 1, 0, 0, 0, 0, 0, '', '', '', 1, 3, '2017-08-06 20:48:53', '2018-07-10 17:21:39');
