(44, 'Tổng quan nhà liền kề ST4 – Camelia Homes', 'tong-quan-nha-lien-ke-st4-camelia-homes', '', 33, 'vietnamese', '[\"33\"]', '/uploads/images/products/st4.jpg', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '<ul style=\"box-sizing: border-box; margin: 0px; padding-right: 0px; padding-left: 0px; border: 0px; font-stretch: inherit; font-size: 15px; line-height: 22.5px; font-family: Roboto; vertical-align: baseline; list-style: circle; color: rgb(68, 68, 68); background-color: rgb(225, 226, 228);\">\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 12pt; line-height: inherit; font-family: \'times new roman\', times, serif; vertical-align: baseline;\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Vị trí:</strong>&nbsp;Gamuda Gardens</span></li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">&nbsp;</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: left;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 12pt; line-height: inherit; font-family: \'times new roman\', times, serif; vertical-align: baseline;\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">CĐT:</strong>&nbsp;Cty Gamuda Land</span></li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: left;\">&nbsp;</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: left;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 12pt; line-height: inherit; font-family: \'times new roman\', times, serif; vertical-align: baseline;\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Nhà liền kề:</strong>&nbsp;418 căn</span></li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: left;\">&nbsp;</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; text-align: left;\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Giá</strong>&nbsp;: 7 tỷ – 9,5 tỷ</li>\r\n</ul>', '<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 32px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">Tổng quan nhà liền kề ST4 – Camelia Homes</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Với những ưu điểm về vị trí dự án cũng như thiết kế cảnh quan,&nbsp;<span style=\"box-sizing: border-box; font-weight: 700;\">Gamuda Gardens</span>&nbsp;trong giai đoạn 1 và giai đoạn 2 đã tạo dấu ấn trên thị trường bất động sản phía Nam Hà Nội. Trong giai đoạn 3, Gamuda Land Việt Nam tiếp tục cho ra mắt 133 căn biệt thự liền kề với tên gọi thương mại Camelia Homes ST4 có diện tích nhỏ hơn.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><img alt=\"\" class=\"aligncenter  wp-image-1867\" height=\"522\" sizes=\"(max-width: 747px) 100vw, 747px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/LKBT2.png\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/LKBT2.png 1950w, http://gamudacity.info/wp-content/uploads/2017/06/LKBT2-300x210.png 300w, http://gamudacity.info/wp-content/uploads/2017/06/LKBT2-1024x715.png 1024w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"747\" /></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\">Vị trí Nhà liền kề ST4 trong khu đô thị Gamuda</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Nằm trong khuôn viên Gamuda Gardens – Khu đô thị tốt nhất Hà Nội, Camelia Homes là chốn an cư lý tưởng cho những gia đình tìm kiếm không gian sống xanh mát, rời xa những ồn ào của chốn đô thị trung tâm. Những dãy nhà liền kề thiết kế hiện đại, rộng thoáng, bao bọc bởi sân trước và vườn sau, tạo thành một thể kiến trúc thống nhất và năng động. Sở hữu điểm nhấn là những đóa hoa trà duyên dáng, hài hòa và cân đối, Camelia Homes mang đến nét độc đáo, chấm phá trong quang cảnh xanh mướt tại Khu đô thị Gamuda Gardens. Mô hình kiến trúc 3 tầng trên diện tích đất từ 105m2 – 271 m2, diện tích xây dựng từ 196m2 – 204m2, cho phép gia chủ tạo dựng một không gian phù hợp cho mọi sinh hoạt gia đình và mục đích sử dụng.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><img alt=\"\" class=\"aligncenter  wp-image-1869\" height=\"555\" sizes=\"(max-width: 741px) 100vw, 741px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/lien-ke-st4-gamuda.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/lien-ke-st4-gamuda.jpg 650w, http://gamudacity.info/wp-content/uploads/2017/06/lien-ke-st4-gamuda-300x225.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" width=\"741\" /></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\">Mô hình nhà liền kề ST4</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Với sân trước, vườn sau bao quanh ngôi nhà, mỗi căn liền kề ST4 đều có 3 mặt thoáng cùng hệ thống cửa sổ kính lớn giúp không gian sống của gia chủ được rộng mở, đón trọn những nguồn ánh sáng và luồng gió tự nhiên vào từng góc phòng. Mỗi tầng đều có những khoảng không gian chung của gia đình như phòng khách, phòng đọc sách hay phòng học, phòng thờ …trong khi vẫn đảm bảo những không gian riêng rộng mở như phòng ngủ lớn và nhỏ được thiết kế hài hòa.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: center;\"><img alt=\"\" class=\"aligncenter size-full wp-image-1874\" height=\"460\" sizes=\"(max-width: 650px) 100vw, 650px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/U297gRk.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/U297gRk.jpg 650w, http://gamudacity.info/wp-content/uploads/2017/06/U297gRk-300x212.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; clear: both;\" width=\"650\" />Phối cảnh thiết kế liền kề ST4</p>\r\n\r\n<div class=\"wp-caption alignnone\" id=\"attachment_3974\" style=\"box-sizing: border-box; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; text-align: justify;\">\r\n<p class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><span style=\"box-sizing: border-box; font-size: 24px; color: rgb(0, 128, 0);\"><span style=\"box-sizing: border-box; font-weight: 700;\">Phong Cách Sống Lành Mạnh</span></span></p>\r\n</div>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><span style=\"box-sizing: border-box; font-size: 16px;\">Liền kề ST4 Gamuda là một ngôi vườn trong phố với không gian xanh, thanh bình của vườn cây, tiểu cảnh nước hòa mình vào những sắc xanh trong lành của công viên, đường dạo và những tiện ích cộng đồng hiện đại khác thuộc Khu đô thị Gamuda Gardens</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 14px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; line-height: 20px; text-align: justify;\"><img alt=\"\" class=\"aligncenter size-full wp-image-1868\" height=\"449\" sizes=\"(max-width: 650px) 100vw, 650px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/FPE3zao.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/FPE3zao.jpg 650w, http://gamudacity.info/wp-content/uploads/2017/06/FPE3zao-300x207.jpg 300w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%; display: block; margin: 0.4em auto 1.6em; text-align: center; clear: both;\" 