ide; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Giá bán</span>: từ 45 – 60 triệu/m2</span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Giá hấp dẫn chỉ từ 6,8 tỷ đến 8.5 tỷ</span></span></li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Hoàn thiện:</span>&nbsp;Mặt ngoài và bàn giao thô</li>\r\n	<li style=\"box-sizing: border-box; list-style-type: disc; list-style-position: inside; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; font-size: 16px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Bàn giao:</span>&nbsp;Quý 4/2018</span></li>\r\n</ul>\r\n\r\n<div class=\"wp-caption alignleft\" id=\"attachment_4013\" style=\"box-sizing: border-box; display: inline; float: left; margin: 0.4em 1.6em 1.2em 0px; font-family: \'Segoe UI\', \'Open Sans\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px; text-align: justify; width: 832px;\">\r\n<p class=\"wp-caption-text\" style=\"box-sizing: border-box; margin: 0px 0px 10px;\"><img alt=\"\" class=\"aligncenter  wp-image-1871\" height=\"493\" sizes=\"(max-width: 832px) 100vw, 832px\" src=\"http://gamudacity.info/wp-content/uploads/2017/06/M%E1%BA%B7t-b%E1%BA%B1ng-ST4-tung-t%E1%BA%A7ng.jpg\" srcset=\"http://gamudacity.info/wp-content/uploads/2017/06/Mặt-bằng-ST4-tung-tầng.jpg 1165w, http://gamudacity.info/wp-content/uploads/2017/06/Mặt-bằng-ST4-tung-tầng-300x178.jpg 300w, http://gamudacity.info/wp-content/uploads/2017/06/Mặt-bằng-ST4-tung-tầng-1024x606.jpg 1024w\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; height: auto; max-width: 100%;