lor: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\"><img alt=\"mat-bang-lien-ke-gamuda-st3-tang-2\" class=\"alignnone size-full wp-image-1675\" height=\"1167\" sizes=\"(max-width: 733px) 100vw, 733px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-tang-2.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-tang-2.jpg 733w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-tang-2-188x300.jpg 188w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-tang-2-643x1024.jpg 643w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"733\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng thiết kế tầng 2</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\"><img alt=\"mat-bang-lien-ke-gamuda-st3\" class=\"alignnone size-full wp-image-1674\" height=\"1054\" sizes=\"(max-width: 810px) 100vw, 810px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3.jpg 810w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-231x300.jpg 231w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-768x999.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/05/mat-bang-lien-ke-gamuda-st3-787x1024.jpg 787w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"810\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng thiêt tầng 3</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Cả khu bao gồm 124 căn nhà liền kề được thiết kế phù hợp với sân trước và vườn sau ôm trọn tòa nhà 3 tầng, toàn bộ căn nhà được tận hưởng nguồn ánh sáng và gió tự nhiên.</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Thông số kĩ thuật</strong></span></h3>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\">\r\n<div style=\"box-sizing: inherit;\">\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích đất: Từ 115 – 300m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích xây dựng 3 tầng: Từ 152m2 – 250m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng ngủ: 4 phòng ngủ chính và 1 phòng ngủ giúp việc.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng vệ sinh: 05 phòng.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Kích thước tiêu chuẩn : Từ &nbsp;5.5 X 21 M.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hình thức sử hữu: Sổ đỏ vĩnh viễn.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Giá bán: Từ 43 đến 65 triệu/m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tổng giá : Từ 7.4 – 12 tỷ.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mức độ hoàn thiện : Hoàn thiên mặt ngoài và bàn giao thô bên trong.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tình trạng: Đã xong phần khung, dự kiến bàn giao vào Quý IV/2017.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mật độ xây dựng : 45 %.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Những vườn cây sinh thái đa dạng, đậm sắc màu của thiên nhiên và những tổ hợp kiến trúc tiện ích công cộng hiện đại, Biệt thự,&nbsp;<a href=\"http://gamudagardens.vn/nha-lien-ke-gamuda-gardens-giai-doan-3-camellia/\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); text-decoration: none; cursor: pointer; transition: all 0.3s ease-in-out; background-color: transparent;\">Liền kề Gamuda</a>&nbsp;giai đoạn 2 mang tới cho cư dân một cuộc sống hoàn hảo, tiện nghi và lãng mạn.</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inheri