nherit; font-family: arial, helvetica, sans-serif;\">Phòng ngủ: 4 phòng ngủ chính và 1 phòng ngủ giúp việc.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng vệ sinh: 05 phòng.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Kích thước tiêu chuẩn : Từ &nbsp;5.5 X 21 M.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hình thức sử hữu: Sổ đỏ vĩnh viễn.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Giá bán: Từ 43 đến 65 triệu/m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tổng giá : Từ 7.4 – 12 tỷ.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mức độ hoàn thiện : Hoàn thiên mặt ngoài và bàn giao thô bên trong.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tình trạng: Đã xong phần khung, dự kiến bàn giao vào Quý IV/2017.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mật độ xây dựng : 45 %.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Những vườn cây sinh thái đa dạng, đậm sắc màu của thiên nhiên và những tổ hợp kiến trúc tiện ích công cộng hiện đại, Biệt thự,&nbsp;<a href=\"http://gamudagardens.vn/nha-lien-ke-gamuda-gardens-giai-doan-3-camellia/\" style=\"color: rgb(0, 0, 0); box-sizing: inherit; text-decoration: none; cursor: pointer; transition: all 0.3s ease-in-out; background-color: transparent;\">Liền kề Gamuda</a>&nbsp;giai đoạn 2 mang tới cho cư dân một cuộc sống hoàn hảo, tiện nghi và lãng mạn.</span></p>\r\n\r\n<h2 style=\"line-height: 1.1; box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 14pt;\"><strong style=\"box-sizing: inherit;\">Hình ảnh thực tế nhà liền kề Gamuda giai đoạn 1</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"lien-ke-gamuda-gardens\" data-id=\"1508\" src=\"http://gamudacityhanoi.com/media/1259/nha-lien-ke-gamuda-garden.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hình ảnh thực tế nhà liền kề gamuda</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"khu-vui-choi-cho-tre-nho-trong-gamuda\" data-id=\"1626\" src=\"http://gamudacityhanoi.com/media/1362/khu-vui-choi-gamuda-garden.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; line-height: 25.6px; te