he-zen-residence.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/the-zen-residence-300x189.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/the-zen-residence-768x483.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"The ZEN Residence -Gamuda Gardens\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các&nbsp;căn hộ có hướng view vào khu biệt thự liền kề rất đẹp</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: inherit;\">Ngoài ra Cư dân</span>&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">The Zen Residence</a>&nbsp;<span style=\"box-sizing: inherit;\">được sử dụng toàn bộ tiện ích hạ tầng khép kín của Gamuda Gardens như Bể bơi ngoài trời tiêu chuẩn Olympic 50 x 25 m; &nbsp;khu thể thao với 3&nbsp;sân Tennis; 2&nbsp;sân bóng rổ; trường công của Thành phố ngay trong dự án; trường liên cấp quốc tế SIS; khu nhà câu lạc bộ Clubhouse; khu nhà phố Shophouse; bệnh viện quốc tế; &nbsp;công viên cây xanh…</span></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><img alt=\"truong-mam-non-trong-khu-do-thi-gamuda\" class=\"alignnone wp-image-1144 size-full\" height=\"592\" sizes=\"(max-width: 792px) 100vw, 792px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/09/truong-mam-non-trong-khu-do-thi-gamuda.png\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/09/truong-mam-non-trong-khu-do-thi-gamuda.png 792w, http://gamudagardens.vn/wp-content/uploads/2016/09/truong-mam-non-trong-khu-do-thi-gamuda-300x224.png 300w, http://gamudagardens.vn/wp-content/uploads/2016/09/truong-mam-non-trong-khu-do-thi-gamuda-768x574.png 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Tiện ích khu đô thị Gamuda Gardens\" width=\"792\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Trường mầm non quốc tế trong khu đô thị Gamuda Gardens</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><img alt=\"tien-ich-cho-cu-dan-biet-thu-gamuda-gardens\" class=\"alignnone wp-image-859 size-full\" height=\"500\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-cho-cu-dan-biet-thu-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-cho-cu-dan-biet-thu-gamuda-gardens.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-cho-cu-dan-biet-thu-gamuda-gardens-300x188.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-cho-cu-dan-biet-thu-gamuda-gardens-768x480.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Tiện ích Gamuda gardens\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các tiện ích trong Gamuda Gardens</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 14pt; color: rgb(0, 128, 0);\">Giá bán và Tiến độ thanh toán</span></strong></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hiện tại chung cư The Zen Residence đang mở bán tòa B, tòa căn hộ đẹp nhất khu đô thị. Giá căn hộ dao động từ 26 – 29 Triệu/m2.</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0);\">Tiến độ thanh toán</span></strong></span></h3>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 1: Thanh toán 10% kí Hợp đồng mua bán.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 2: Thanh toán 10% khi xong tầng 5</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 3: Thanh toán 5% khi xong tầng 10</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 4: Thanh toán 5% khi xong tầng 15</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 5: Thanh toán 5% khi xong tầng 20</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 6: Thanh toán 5% khi xong tầng 25</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 7: Thanh toán 5%&nbsp;khi hoàn thành kết cấu mái của tòa nhà.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 8: Thanh toán 5%&nbsp;kể từ ngày hoàn thành lắp đặt các cửa căn hộ(Tùy từng tầng).</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 9: Thanh toán 2% khi có thông báo nhận bàn giao căn hộ.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 10&nbsp;đến đợt 32: Thanh toán mỗi tháng 2% trong 23&nbsp;tháng Sau khi nhận nhà.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đợt 33: Thanh toán 2% còn lại trong 10 ngày khi có thông báo cấp&nbsp;sổ đỏ.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Qúy khách quan tâm đến căn hộ&nbsp;<a href=\"http://gamudagardens.vn/chung-cu-the-zen-residence/\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">chung cư The Zen Residence</a>&nbsp;vui lòng liên hệ để nhận thông tin mới nhất.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; background-color: rgb(248, 248, 248);\">HOTLINE</span><em style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; box-sizing: inherit;\"><span style=\"background-color: rgb(248, 248, 248);\">&nbsp;☎ &nbsp;</span>0936130538</em></p>', 'BFA with specialization in Painting&amp;amp;lt;br&amp;amp;gt;Batch: 2010-14', 'null', 'null', 0, 24, 1, -1, 0, 0, 0, 0, '', '', '', 1, 3, '2017-08-06 22:42:26', '2019-08-19 22:13:31');
INSERT INTO `articles` (`id`, `title`, `slug`, `canonical`, `cataloguesid`, `alanguage`, `catalogues`, `images`, `albums`, `description`, `content`, `content2`, `country`, `hedaotao`, `order`, `viewed`, `publish`, `highlight`, `ishome`, `isaside`, `isfooter`, `trash`, `meta_title`, `meta_keyword`, `meta_description`, `userid_created`, `userid_updated`, `created`, `updated`) VALUES
(51, 'Tiểu khu Phong Lan', 'tieu-khu-phong-lan', 'tieu-khu-phong-lan', 17, 'vietnamese', '[\"17\"]', '/uploads/images/bai-viet/news/home-villa-phonglan.jpg', '\"\"', '<p>Công ty cổ phần Dịch vụ kỹ thuật viễn thông (TST), đơn vị thành viên của Tập đoàn Bưu chính Viễn thông Việt Nam (VNPT), là một doanh nghiệp Nhà nước được cổ phần hóa vào năm 2000. Công ty cổ phần Dịch vụ kỹ thuật viễn thông (TST), đơn vị thành viên của Tập đoàn Bưu chính Viễn thông Việt Nam (VNPT), là một doanh nghiệp Nhà nước được cổ phần hóa vào năm 2000. Công ty cổ phần Dịch vụ kỹ thuật viễn thông (TST), đơn vị thành viên của Tập đoàn Bưu chính Viễn thông Việt Nam (VNPT), là một doanh nghiệp Nhà nước được cổ phần hóa vào năm 2000.</p>', '<p class=\"short_intro txt_666\" style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Gamuda Gardens hiện đang là khu đô thị sinh thái kiểu mẫu tại Hà Nội với phong cách thiết kế ấn tượng của những căn nhà vườn sang trọng, hiện đại . Khu đô thị đang ngày càng đẹp hơn khi các hạng mục tiện ích trong dự án đang được chủ đầu tư gấp rút hoàn thiện.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khu biệt thự song lập SD5 Iris Homes có vị trí đắc địa trong khu đô thị Gamuda Gardens, Iris Homes tiếp giáp với&nbsp;khu biệt thự đơn lập – trái tim của dự án với&nbsp;những công viên cây xanh chạy dọc trong nội khu, Khu Iris Homes rất gần&nbsp;cổng chính thứ 2 của dự án, nơi có những con đường nối thẳng vào trung tâm thành phố như Tam Trinh, tuyến đường tương lai Yên Duyên – Minh Khai, đường nối thẳng từ khu đô thị đến&nbsp;Times City chỉ cách 2Km.</span></p>\r\n\r\n<h3 class=\"short_intro txt_666\" style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><img alt=\"biet-thu-song-lap-sd5-gamuda-iris-homes\" class=\"alignnone size-full wp-image-2212\" height=\"500\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2017/05/biet-thu-song-lap-sd5-gamuda-iris-homes.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2017/05/biet-thu-song-lap-sd5-gamuda-iris-homes.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2017/05/biet-thu-song-lap-sd5-gamuda-iris-homes-300x176.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2017/05/biet-thu-song-lap-sd5-gamuda-iris-homes-768x452.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phối cảnh mặt trước khu biệt thự song lập SD5 Iris Homes</span></p>\r\n\r\n<div class=\"fck_detail width_common block_ads_connect\" style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: inherit; line-height: 1.1; color: inherit;\"><span style=\"box-sizing: inherit; font-size: 14pt;\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\">Thiết kế&nbsp;Biệt thự song lập Gamuda Iris Homes</span></strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các căn biệt thự tại&nbsp;Iris Homes được thiết kế theo kiến trúc xanh, giúp tiết kiệm năng lượng và thân thiện với môi trường. Phong cách thiết kế mang đến không gian sống và làm việc lành mạnh, tăng cường sức khỏe và chất lượng cuộc sống, nâng cao giá trị căn nhà trong tương lai.&nbsp;Chủ đầu tư dự án chú trọng thiết kế tỉ mỉ nhằm đảm bảo tiện ích, không gian sống xanh, công năng sử dụng.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"biet-thu-song-lap-iris-homes-gamuda-gardens\" class=\"alignnone size-full wp-image-2211\" height=\"502\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2017/05/biet-thu-song-lap-iris-homes-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2017/05/biet-thu-song-lap-iris-homes-gamuda-gardens.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2017/05/biet-thu-song-lap-iris-homes-gamuda-gardens-300x177.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2017/05/biet-thu-song-lap-iris-homes-gamuda-gardens-768x454.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Những căn biệt thự với nhiều ban công xanh mát</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Giải pháp cây xanh và hệ thống mái lớn chống nóng giảm bức xạ trực tiếp của mặt trời vào ngôi nhà, tạo nên một không gian tươi mới thoáng đãng ngay cả trong những ngày hè nóng nực, giữ cho nhiệt độ trong các phòng luôn ở mức dễ chịu.&nbsp;Từ ý tưởng mang thiên nhiên hài hòa vào thiết kế, từng căn biệt thự Iris Homes tràn ngập không gian xanh với vườn treo tươi mát ở sân trước hay khóm hoa ở ban công và cửa sổ.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"thiet-ke-biet-thu-song-lap-gamuda-iris-homes\" class=\"alignnone size-full wp-image-2215\" height=\"551\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2017/05/thiet-ke-biet-thu-song-lap-gamuda-iris-homes.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2017/05/thiet-ke-biet-thu-song-lap-gamuda-iris-homes.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2017/05/thiet-ke-biet-thu-song-lap-gamuda-iris-homes-300x194.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2017/05/thiet-ke-biet-thu-song-lap-gamuda-iris-homes-768x498.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bên của các căn biệt thự song lập với những ô kính lớn</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các kiến trúc sư đã quy hoạch tổng thể chia ô nhà với diện tích hợp lý để khoảng vườn xanh phía trước rộng rãi, thoáng đãng kết hợp chỗ để ôtô, trong khi khoảng lùi sân sau có thể làm nơi thư giãn, nấu ăn cho gia chủ.</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: inherit; line-height: 1.1; color: inherit;\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\">Thông số cơ bản khu biệt thự song lập Gamuda SD5:</span></strong></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Iris Homes bao gồm 77 căn biệt thự song lập, mỗi căn nhà có mặt tiền từ 7m và sâu từ 21m, được xây dựng với chiều cao vừa phải gồm 3,5 tầng. Mặt bằng các tầng được thiết kế tỉ mỉ với phòng khách, phòng ăn và bếp có tầm nhìn sân vườn ở tầng 1, các phòng ngủ đan xen với ban công và logia rộng mở ở cả tầng 2 và tầng 3.</span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Biệt thự song lập Iris Homes: Tiểu khu Eden</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích đất:&nbsp;Từ 147 – 303,3m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích xây dựng: Từ 265 đến 292m2/3,5 tầng</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng ngủ: 4&nbsp;phòng ngủ , 1 phòng cho người giúp việc và 1 phòng thờ trên tầng cao nhất.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng vệ sinh: 05 phòng.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Kích thước các căn tiêu chuẩn : 7&nbsp;X 21 M.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hình thức sử hữu: Sổ đỏ vĩnh viễn.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Giá bán: Từ 62 đến 78 triệu/m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tổng giá : Từ 10,5 – 18 tỷ.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mức độ hoàn thiện : Hoàn thiện mặt ngoài và bàn giao thô bên trong.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mật độ xây dựng : 35 %</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Bàn giao: Qúy I/2019</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"mat-bang-biet-thu-song-lap-gamuda-iris-homes\" class=\"alignnone size-full wp-image-2213\" height=\"674\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2017/05/mat-bang-biet-thu-song-lap-gamuda-iris-homes.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2017/05/mat-bang-biet-thu-song-lap-gamuda-iris-homes.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2017/05/mat-bang-biet-thu-song-lap-gamuda-iris-homes-300x238.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2017/05/mat-bang-biet-thu-song-lap-gamuda-iris-homes-768x609.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng thiết kế biệt thự song lập SD5 – Iris Homes Căn tiêu chuẩn</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Iris Homes đem đến nhiều tiện ích tối ưu, đáp ứng nhu cầu của cư dân. Khu biệt thự được bao quanh bởi những thảm cỏ, tán cây xanh, tạo nên không gian xanh mát, thoáng đãng để các gia đình có thể&nbsp;tổ chức picnic, tiệc BBQ ngoài trời hay tản bộ, đạp xe, chơi thể thao.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"khong-gian-xanh-gamuda-gardens\" class=\"alignnone size-full wp-image-1997\" height=\"538\" sizes=\"(max-width: 806px) 100vw, 806px\" src=\"http://gamudagardens.vn/wp-content/uploads/2017/03/khong-gian-xanh-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2017/03/khong-gian-xanh-gamuda-gardens.jpg 806w, http://gamudagardens.vn/wp-content/uploads/2017/03/khong-gian-xanh-gamuda-gardens-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2017/03/khong-gian-xanh-gamuda-gardens-768x513.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2017/03/khong-gian-xanh-gamuda-gardens-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"806\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Những khu vườn rộng rãi để làm tiệc nướng BBQ ngoài trời trong khu biệt thự giai đoạn 1</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">So với khu&nbsp;biệt thự song lập giai đoạn 1 và giai đoạn 2 thì biệt thự song lập giai đoạn 3 được thiết kế với nhiều điểm ưu việt và phù hợp với phong cách sống của người Việt hơn:</span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Số lượng căn từ đầu dãy đến cuối dãy ít nhất chỉ từ 6 -10 căn/dãy do đó mật độ sử dụng sẽ rất thấp và mật độ cây xanh lớn cũng như vỉa hè thông thoáng nhất.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Với việc&nbsp;xây dựng cao 3,5 tầng thay vì 3 tầng như các giai đoạn trước sẽ tối ưu hóa diện tích sử dụng cho gia chủ. Tầng 2 và tầng 3 đều có ban công lớn, các phòng cũng đều có hệ thống cửa sổ lớn giúp đón trọn ánh sáng và gió tự nhiên.&nbsp;</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Màu sơn nhà: trắng sáng và ghi khi kết hợp sẽ cho cảm giác sang trọng tinh tế, hệ mái xanh đen và gạch thẻ ghi gỗ ấm áp, tạo nên sự sắc nét về cảnh quan bên ngoài rất trang nhã nhưng không kém phần sang trọng.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đặc biệt với đường nội bộ 2 chiều rộng rãi và hệ thống cây xanh chạy dọc cả khu, biệt thự song lập SD5 Iris Homes sẽ mang đến cuộc sống thoải mái nhất cho gia chủ.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Ngoài ra, câu lạc bộ Gamuda Gardens với bể bơi tiêu chuẩn Olympic, khu vực spa và gym hiện đại cùng hệ thống giáo dục toàn diện với mô hình trường Liên cấp quốc tế Singapore (SIS) giúp cư dân và thế hệ tương lai có cuộc sống lành mạnh, cân bằng và bền vững.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"tien-ich-cho-cu-dan-biet-thu-gamuda-gardens\" class=\"alignnone size-full wp-image-1003\" height=\"500\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/09/tien-ich-cho-cu-dan-biet-thu-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/09/tien-ich-cho-cu-dan-biet-thu-gamuda-gardens.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/09/tien-ich-cho-cu-dan-biet-thu-gamuda-gardens-300x188.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/09/tien-ich-cho-cu-dan-biet-thu-gamuda-gardens-768x480.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tiện ích trong khu đô thị Gamuda Gardens</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"\" class=\"alignnone size-full wp-image-1998\" height=\"538\" sizes=\"(max-width: 806px) 100vw, 806px\" src=\"http://gamudagardens.vn/wp-content/uploads/2017/03/khu-do-thi-gamuda-garden.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2017/03/khu-do-thi-gamuda-garden.jpg 806w, http://gamudagardens.vn/wp-content/uploads/2017/03/khu-do-thi-gamuda-garden-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2017/03/khu-do-thi-gamuda-garden-768x513.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2017/03/khu-do-thi-gamuda-garden-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"806\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Không gian xanh trong khu biệt thự giai đoạn 1</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"\" class=\"alignnone size-full wp-image-1684\" height=\"640\" sizes=\"(max-width: 960px) 100vw, 960px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/khong-gian-thoang-doang-biet-thu-song-lap-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/khong-gian-thoang-doang-biet-thu-song-lap-gamuda-gardens.jpg 960w, http://gamudagardens.vn/wp-content/uploads/2016/08/khong-gian-thoang-doang-biet-thu-song-lap-gamuda-gardens-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/khong-gian-thoang-doang-biet-thu-song-lap-gamuda-gardens-768x512.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/08/khong-gian-thoang-doang-biet-thu-song-lap-gamuda-gardens-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"960\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khu vui chơi cho trẻ nhỏ</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"khu-biet-thu-song-lap-gamuda-garden\" class=\"alignnone size-full wp-image-732\" height=\"532\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/khu-biet-thu-song-lap-gamuda-garden.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/khu-biet-thu-song-lap-gamuda-garden.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/08/khu-biet-thu-song-lap-gamuda-garden-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/khu-biet-thu-song-lap-gamuda-garden-768x511.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/08/khu-biet-thu-song-lap-gamuda-garden-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khu biệt thự song lập giai đoạn 1</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Ngày 05/08, chủ đầu tư sẽ tổ chức giới thiệu sản phẩm Iris Homes tại nhà câu lạc bộ, khu đô thị Gamuda Gardens, Hoàng Mai, Hà Nội. Gamuda Land dành tặng cho khách hàng chiết khấu lên tới 8% cho mỗi hợp đồng mua bán, miễn phí 2 năm gói thành viên câu lạc bộ Gamuda Gardens và 2 năm phí quản lý.</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: inherit; line-height: 1.1; color: inherit;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Liên hệ trực tiếp Phòng Kinh doanh Gamuda Land để nhận thông tin mới nhất:</span></h3>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; background-color: rgb(248, 248, 248);\">HOTLINE</span><em style=\"color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; font-weight: bold; text-align: justify; box-sizing: inherit;\"><span style=\"background-color: rgb(248, 248, 248);\">&nbsp;☎ &nbsp;</span>0936130538</em></p>\r\n</div>', 'Phong cách Pháp', 'null', 'null', 0, 44, 1, -1, 0, 0, 0, 0, '', '', '', 1, 3, '2017-08-06 22:57:15', '2018-07-10 17:21:06'),
(52, 'Tiểu khu Tulip', 'tieu-khu-tulip', 'tieu-khu-tulip', 17, 'vietnamese', '[\"17\"]', '/uploads/images/bai-viet/news/home-villa-tulip.jpg', '\"\"', '<p>Nullam dolor sapien, egestas pharetra quam sed, blandit efficitur nunc. Nunc vel lacus quam. Sed bibendum dui et nibh pellentesque, eget dignissim arcu mollis. Pellentesque gravida eu lorem non ornare. Pellentesque et finibus lorem.</p>', '<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">CHÍNH SÁCH BÁN HÀNG MỚI NHẤT CHO SẢN PHẨM BIỆT THỰ SONG LẬP COURTYARD HOMES</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif;\">&nbsp;&nbsp;<strong style=\"box-sizing: inherit;\">Tiến Độ Thanh Toán:</strong></span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thanh toán trả chậm 3 Năm 0% lãi suất Kể từ khi nhận nhà.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; color: rgb(255, 0, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">&nbsp; &nbsp; Khuyến Mãi Chung:</strong></span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tặng 5&nbsp;năm phí quản lý và 5 năm phí sử dụng câu lạc bộ.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chiết khấu 5% giá trị biệt thự.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Miễn giảm 20% học phí tại Trường liên cấp quốc tế Singapore( SIS).</span></li>\r\n</ul>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Chương trình Kỉ niệm 10 năm thành lập Gamuda Land tại Việt Nam,&nbsp;Bốc thăm 3 xe Mercedes, 10 xe Liberty và nhiều phần quà giá trị khác.</span></li>\r\n</ul>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-size: 14pt; font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Tổng quan biệt thự song lập Gamuda – Courtyard Homes</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tọa lạc tại một trong những vị trí đắc địa thuộc Tiểu khu Tropical, Biệt thự Song lập Courtyard homes là sự chắt loc của phong cách thiết kế đương đại với hai căn nhà biệt lập đối xứng, ghép lại tạo thành một thể kiến trúc thống nhất và giàu tính thẩm mỹ.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"phoi-canh-gamuda-gardens\" class=\"alignnone wp-image-721 size-full\" height=\"617\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/phoi-canh-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/08/phoi-canh-gamuda-gardens.jpg 900w, http://gamudagardens.vn/wp-content/uploads/2016/08/phoi-canh-gamuda-gardens-300x206.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/08/phoi-canh-gamuda-gardens-768x527.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Phối cảnh khu đô thị Gamuda Gardens\" width=\"900\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tổng quan dự án Gamuda Gardens</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Vinh dự nhận giải thường ” Khu đô thị đáng sống nhất tại Hà Nội”.&nbsp;<a href=\"http://gamudagardens.vn/\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(0, 0, 0); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">Gamuda gardens</a>&nbsp;được đánh giá là một khu đô thị có quy hoặch tổng thế thông minh, giàu tính nhân văn, thiết kế chất lượng, phát triển bền vững và giá trị cốt lõi độc đáo.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"biet-thu-gamuda-biet-thu-song-lap\" class=\"alignnone wp-image-1476 size-full\" height=\"499\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-biet-thu-song-lap.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-biet-thu-song-lap.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-biet-thu-song-lap-300x176.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-biet-thu-song-lap-768x451.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Biệt thự song lập gamuda Giai đoạn 2\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phối cảnh khu biệt thự song lập loại mới nhất</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">&nbsp; &nbsp; &nbsp; Mỗi căn nhà tại Gamuda Gardens đều được xây dựng trên 4 giá trị cốt lõi: ” Chất lượng thiết kế, phong cách sống lành mạnh, Tiện ích – Cộng đồng, An ninh -An toàn”.</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-size: 14pt; font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Thiết kế&nbsp;biệt thự song lập Gamuda – Courtyard Homes</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: inherit;\">Dãy</span>&nbsp;<a href=\"http://kdtgamudacity.com\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">biệt thự&nbsp;Song Lập</a>&nbsp;<span style=\"box-sizing: inherit;\">Courtyard Homes là ngôi nhà vườn trong phố với không gian xanh, thanh bình của vườn cây, tiểu cảnh nước hòa mình cùng sắc xanh trong lành của công viên.</span></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"phoi-canh-biet-thu-song-lap-gamuda-gardens\" class=\"alignnone wp-image-1479 size-full\" height=\"524\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/phoi-canh-biet-thu-song-lap-gamuda-gardens.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/phoi-canh-biet-thu-song-lap-gamuda-gardens.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/phoi-canh-biet-thu-song-lap-gamuda-gardens-300x185.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/phoi-canh-biet-thu-song-lap-gamuda-gardens-768x473.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Biệt thự Gamuda Gardens\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mỗi căn Courtyard Homes cao 3 tầng được xây dựng trên diện tích đất từ 188 – 429m2, với tổng diện tích sàn xây dựng 256 m2. Với sân trước, vườn sau bao quanh ngôi nhà, mỗi căn Courtyard Homes đều có 3 mặt thoáng cùng hế thống cửa sổ kính lớn giúp không gian sống của gia chủ được rộng mở, đón trọn những nguồn ánh sáng và luồng gió tự nhiên vào từng góc phòng. Mỗi tầng đều có những khoảng không gian chung của gia đình như phòng khách, phòng đọc sách hay phòng học, trong khi vẫn đảm bảo được không gian riêng rộng mở như phòng ngủ lớn và nhỏ được thiết kế hài hòa.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><img alt=\"biet-thu-song-lap-gamuda-sd44\" class=\"alignnone size-full wp-image-2287\" height=\"649\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-song-lap-gamuda-sd44.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-song-lap-gamuda-sd44.jpg 850w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-song-lap-gamuda-sd44-300x229.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-song-lap-gamuda-sd44-768x586.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt trước biệt thự song lập giai đoạn 2 SD44</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><img alt=\"thiet-ke-biet-thu-song-lap-gamuda-loai-moi\" class=\"alignnone wp-image-972 size-full\" height=\"538\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/04/thiet-ke-biet-thu-song-lap-gamuda-loai-moi.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/04/thiet-ke-biet-thu-song-lap-gamuda-loai-moi.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/04/thiet-ke-biet-thu-song-lap-gamuda-loai-moi-300x202.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/04/thiet-ke-biet-thu-song-lap-gamuda-loai-moi-768x516.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/04/thiet-ke-biet-thu-song-lap-gamuda-loai-moi-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Mặt bằng thiết kế biệt thự gamuda\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Mặt bằng thiết kế biệt thự song lập SD44</span></p>\r\n\r\n<h3 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Thông số kĩ thuật</strong></span></h3>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích đất : 189m2 – 500m2.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Diện tích xây dựng 3 tầng: 256m2 – 300 m2</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Kích thước: Mặt tiền từ 9-12m. Chiều sâu nhà : 21.5m</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng ngủ: 5 phòng + 1 phòng ngủ cho giúp việc.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng tắm: 06 phòng.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Thời hạn sử dụng đất: Sổ đỏ&nbsp;vĩnh viễn</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Đầy đủ các hướng: Bắc,&nbsp;Đông Bắc, Tây Nam, Tây Bắc.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Giá bán: Từ 55 đến 65&nbsp;triệu/m2( Tùy từng vị trí và diện tích) chưa trừ chiết khấu.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Tình trạng: Đang xây dựng, Dự kiến bàn giao Quý II/2018.</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"hinh-anh-biet-thu-song-lap-gamuda-loai-moi\" class=\"alignnone wp-image-1002 size-full\" height=\"500\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/09/hinh-anh-biet-thu-song-lap-gamuda-loai-moi.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/09/hinh-anh-biet-thu-song-lap-gamuda-loai-moi.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/09/hinh-anh-biet-thu-song-lap-gamuda-loai-moi-300x188.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/09/hinh-anh-biet-thu-song-lap-gamuda-loai-moi-768x480.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Thiết kế biệt thự song lập Gamuda Gardens\" width=\"800\" /></p>\r\n</div>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Giếng trời tọa lạc tại giữa ngôi nhà là điểm nhấn tinh tế trong tổng thể kiến trúc của Song Lập Courtyard Homes. Vừa mang ý đồ nghệ thuật, vừa đảm bảo lưu chuyển nguồn năng lượng và hơi thở của thiên nhiên hòa quyện với không gian sống, thiết kế giếng trời còn giúp cho gia chủ có cơ hội mở rộng diện tích sinh hoạt trong sinh hoạt.</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-size: 14pt; font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Tiện ích cho cư dân&nbsp;biệt thự song lập Gamuda – Courtyard Homes</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"tien-ich-khu-do-thi-gamuda-gardens\" class=\"alignnone wp-image-722 size-large\" height=\"341\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/tien-ich-khu-do-thi-gamuda-gardens-1024x341.png\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Tiện ích cho cư dân Gamuda Gardens\" width=\"1024\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Các tiện ích cho cư dân Khu đô thị Gamuda Gardens</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">An cư tại khu đô thị Gamuda gardens, cư dân được tận hưởng không gian sống xanh, yên bình, cộng đồng thân thiện và tiện ích khéo kín bao gồm: Câu lạc bộ Gamuda Gardens, bể bơi tiêu chuẩn quốc tế, sân tennis, sân bóng chuyền, phòng gym, nhà hàng, hội thảo…. hệ thống nhà phố thương mại vứoi đa dạng các cửa hàng ăn uống, quán cafe, siêu thị. Trường liên cấp quốc tế Singapore (SIS).</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"biet-thu-gamuda-gardens-courtyard-homes\" class=\"alignnone wp-image-525 size-full\" height=\"500\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-gardens-courtyard-homes.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-gardens-courtyard-homes.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-gardens-courtyard-homes-300x188.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/05/biet-thu-gamuda-gardens-courtyard-homes-768x480.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" title=\"Không gian xanh khu biệt thự song lập Coutyard\" width=\"800\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Không gian sống xanh trong khu biệt thự song lập Gamuda loại mới</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-size: 14pt; font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\">Hình ảnh thực tế&nbsp;biệt thự song lập Gamuda đã bàn giao</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img alt=\"khu-biet-thu-song-lap-gamuda-garden\" class=\"alignnone wp-image-732 size-full\" height=\"532\" sizes=\"(max-width: 800px) 100vw, 800px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/khu-biet-thu-song-lap-gamuda-garden.jpg