(58, 'Tiện Ích', 'tien-ich', '', 14, 'vietnamese', '[\"14\"]', '', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '', '<div class=\"panel-grid\" id=\"pg-12-0\" style=\"box-sizing: inherit; zoom: 1; margin-right: -15px; margin-bottom: 30px; margin-left: -15px; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; margin-top: 0px !important;\">\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-0-0\" style=\"box-sizing: border-box; min-height: 1em; float: none; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"0\" id=\"panel-12-0-0-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-editor so-widget-sow-editor-base\" style=\"box-sizing: inherit;\">\r\n<div class=\"siteorigin-widget-tinymce textwidget\" style=\"box-sizing: inherit;\">\r\n<h1 class=\"title \" style=\"box-sizing: inherit; font-size: 2.57em; margin: 0.67em 0px; clear: both; font-family: inherit; line-height: 1.1; color: inherit; text-align: center;\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 24pt;\">TIỆN ÍCH GAMUDA GARDENS</span></strong></h1>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><img class=\"aligncenter\" src=\"http://www.opalriverside.vn/template/tint/images/line-can-ho.png\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%; clear: both; display: block; margin-left: auto; margin-right: auto;\" /></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Vui lòng click vào xem chi tiết tiện ích.</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid\" id=\"pg-12-1\" style=\"box-sizing: inherit; zoom: 1; margin-right: -15px; margin-bottom: 30px; margin-left: -15px; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; margin-top: 0px !important;\">\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-1-0\" style=\"box-sizing: border-box; min-height: 1em; width: 586.578px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-image panel-first-child panel-last-child\" data-index=\"1\" id=\"panel-12-1-0-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-image so-widget-sow-image-default-3f547a15eaaa\" style=\"box-sizing: inherit;\">\r\n<div class=\"sow-image-container\" style=\"box-sizing: inherit;\"><img alt=\"truong-quoc-te-sis-gamuda\" class=\"so-widget-image\" height=\"534\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/04/truong-quoc-te-sis-gamuda-1.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/04/truong-quoc-te-sis-gamuda-1.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/04/truong-quoc-te-sis-gamuda-1-300x200.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/04/truong-quoc-te-sis-gamuda-1-768x513.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/04/truong-quoc-te-sis-gamuda-1-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%; display: block;\" title=\"Trường quốc tế SIS\" width=\"800\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-1-1\" style=\"box-sizing: border-box; min-height: 1em; width: 583.406px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"2\" id=\"panel-12-1-1-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-editor so-widget-sow-editor-base\" style=\"box-sizing: inherit;\">\r\n<div class=\"siteorigin-widget-tinymce textwidget\" style=\"box-sizing: inherit;\">\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: inherit; line-height: 1.1; color: inherit;\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif; color: rgb(0, 128, 0);\">Trường học quốc tế SIS</span></strong></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Trường liên kết cấp quốc tế SIS Singapore&nbsp;được thành lập từ dự án Gamuda Gardens dưới hình thức kí kết giữa 2 tập đoàn Gamuda và tập đoàn giáo dục KinderWorld. Tọa lạc trên diện tích đất 2,3 hecta thuộc khu đô thị Gamuda Gardens, Hoàng Mai, Hà Nội. Trường liên cấp quốc tế Singapore dự kiến sẽ đào tao ra hơn 2000 học sinh từ mẫu giáo tới dự bị đại học.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-size: 12pt; font-family: arial, helvetica, sans-serif;\">Hiện tại trường SIS trong&nbsp;<a href=\"http://gamudagardens.vn/\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">khu đô thị Gamuda</a>&nbsp;đã đi vào hoạt động từ tháng 6/2015</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid\" id=\"pg-12-2\" style=\"box-sizing: inherit; zoom: 1; margin-right: -15px; margin-bottom: 30px; margin-left: -15px; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; margin-top: 0px !important;\">\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-2-0\" style=\"box-sizing: border-box; min-height: 1em; width: 586.578px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"3\" id=\"panel-12-2-0-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-editor so-widget-sow-editor-base\" style=\"box-sizing: inherit;\">\r\n<div class=\"siteorigin-widget-tinymce textwidget\" style=\"box-sizing: inherit;\">\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: inherit; line-height: 1.1; color: inherit;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-size: 12pt;\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Clubhouse Gamuda với đầy đủ tiện ích cho cư dân giải trí</span></strong></span></h2>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Bể bơi tiêu chuẩn Olympic</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khu chơi thể thao, Phòng tập Gym, xông hơi…</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Phòng hội nghị Với diện tích 500m2 với sức chứa lên tới 300 khách để các bạn có thể tổ chức sự kiện, hội nghị, hội thảo hay diễn thuyết.</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Nhà hàng sang trọng .</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-2-1\" style=\"box-sizing: border-box; min-height: 1em; width: 583.406px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-image panel-first-child panel-last-child\" data-index=\"4\" id=\"panel-12-2-1-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-image so-widget-sow-image-default-3f547a15eaaa\" style=\"box-sizing: inherit;\">\r\n<div class=\"sow-image-container\" style=\"box-sizing: inherit;\"><img alt=\"khu-tiep-khach-trong-cub-house\" class=\"so-widget-image\" height=\"538\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/04/khu-tiep-khach-trong-cub-house-1.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/04/khu-tiep-khach-trong-cub-house-1.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/04/khu-tiep-khach-trong-cub-house-1-300x202.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/04/khu-tiep-khach-trong-cub-house-1-768x516.jpg 768w, http://gamudagardens.vn/wp-content/uploads/2016/04/khu-tiep-khach-trong-cub-house-1-272x182.jpg 272w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%; display: block;\" title=\"Khu tiếp khách Trong Clubhouse Gamuda\" width=\"800\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid\" id=\"pg-12-3\" style=\"box-sizing: inherit; zoom: 1; margin-right: -15px; margin-bottom: 30px; margin-left: -15px; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; margin-top: 0px !important;\">\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-3-0\" style=\"box-sizing: border-box; min-height: 1em; width: 585px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-image panel-first-child panel-last-child\" data-index=\"5\" id=\"panel-12-3-0-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-image so-widget-sow-image-default-1c389ca87c1a\" style=\"box-sizing: inherit;\">\r\n<div class=\"sow-image-container\" style=\"box-sizing: inherit; text-align: center;\"><img alt=\"ho-cong-vien-yen-so\" class=\"so-widget-image\" height=\"512\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/04/ho-cong-vien-yen-so.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/04/ho-cong-vien-yen-so.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/04/ho-cong-vien-yen-so-300x192.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/04/ho-cong-vien-yen-so-768x492.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%; display: inline-block;\" title=\"Hồ điều hòa Yên Sở\" width=\"800\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-3-1\" style=\"box-sizing: border-box; min-height: 1em; width: 585px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"6\" id=\"panel-12-3-1-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-editor so-widget-sow-editor-base\" style=\"box-sizing: inherit;\">\r\n<div class=\"siteorigin-widget-tinymce textwidget\" style=\"box-sizing: inherit;\">\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: inherit; line-height: 1.1; color: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Công Viên yên Sở</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Là công viên lớn nhất của Hà Nội thuộc dự án Gamuda city với diện tích&nbsp; 323ha đặc biệt được chủ đầu tư Gamuda Berhad quan tâm và phát triển.Với tổng diện tích phủ xanh lên tới 40% Gamuda xứng đáng được gọi là lá phổi xanh của thu đô Hà Nội.</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid\" id=\"pg-12-4\" style=\"box-sizing: inherit; zoom: 1; margin-right: -15px; margin-bottom: 30px; margin-left: -15px; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; margin-top: 0px !important;\">\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-4-0\" style=\"box-sizing: border-box; min-height: 1em; width: 585px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"7\" id=\"panel-12-4-0-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-editor so-widget-sow-editor-base\" style=\"box-sizing: inherit;\">\r\n<div class=\"siteorigin-widget-tinymce textwidget\" style=\"box-sizing: inherit;\">\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: inherit; line-height: 1.1; color: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Nhà Phố Thương Mại</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Dãy&nbsp;nhà&nbsp;phố thương mại Gamuda&nbsp;này nằm ngay tại cổng vào của Gamuda Gardens với các dịch vụ tiện lợi nhất cho người dân như khu văn phòng, ngân hàng, siêu thị, cửa hàng ăn uống , chăm sóc sắc đẹp…</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-4-1\" style=\"box-sizing: border-box; min-height: 1em; width: 585px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-image panel-first-child panel-last-child\" data-index=\"8\" id=\"panel-12-4-1-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-image so-widget-sow-image-default-3f547a15eaaa\" style=\"box-sizing: inherit;\">\r\n<div class=\"sow-image-container\" style=\"box-sizing: inherit;\"><img alt=\"nha-pho-shop-house-gamuda\" class=\"so-widget-image\" height=\"506\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/04/nha-pho-shop-house-gamuda-1.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/04/nha-pho-shop-house-gamuda-1.jpg 800w, http://gamudagardens.vn/wp-content/uploads/2016/04/nha-pho-shop-house-gamuda-1-300x190.jpg 300w, http://gamudagardens.vn/wp-content/uploads/2016/04/nha-pho-shop-house-gamuda-1-768x486.jpg 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%; display: block;\" title=\"Shophouse gamuda\" width=\"800\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid\" id=\"pg-12-5\" style=\"box-sizing: inherit; zoom: 1; margin-right: -15px; margin-bottom: 30px; margin-left: -15px; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; margin-top: 0px !important;\">\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-5-0\" style=\"box-sizing: border-box; min-height: 1em; width: 585px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-image panel-first-child panel-last-child\" data-index=\"9\" id=\"panel-12-5-0-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-image so-widget-sow-image-default-3f547a15eaaa\" style=\"box-sizing: inherit;\">\r\n<div class=\"sow-image-container\" style=\"box-sizing: inherit;\"><img alt=\"tien-ich-khu-do-thi-gamuda-gardens\" class=\"so-widget-image\" height=\"597\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/09/tien-ich-khu-do-thi-gamuda-gardens.png\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/09/tien-ich-khu-do-thi-gamuda-gardens.png 795w, http://gamudagardens.vn/wp-content/uploads/2016/09/tien-ich-khu-do-thi-gamuda-gardens-300x225.png 300w, http://gamudagardens.vn/wp-content/uploads/2016/09/tien-ich-khu-do-thi-gamuda-gardens-768x577.png 768w\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%; display: block;\" title=\"Tiện ích mới Khu đô thị Gamuda Gardens\" width=\"795\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-5-1\" style=\"box-sizing: border-box; min-height: 1em; width: 585px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"10\" id=\"panel-12-5-1-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-editor so-widget-sow-editor-base\" style=\"box-sizing: inherit;\">\r\n<div class=\"siteorigin-widget-tinymce textwidget\" style=\"box-sizing: inherit;\">\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: inherit; line-height: 1.1; color: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-size: 12pt;\">Quy hoạch tiện ích Gamuda Gardens</span></strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Để đảm bảo các cư dân trong khu đô thị Gamuda Gardens được hưởng cuộc sống tiện nghi, hiện đại Gamuda Land&nbsp;&nbsp;tiếp tục triển khai&nbsp;những tiện ích mới, góp phần hoàn thiện cơ sở hạ tầng, đáp ứng nhu cầu an cư của cư dân tại đây bao gồm các hạng mục:</span></p>\r\n\r\n<ul style=\"box-sizing: inherit; margin: 0px 0px 1px 1px; list-style-position: initial; list-style-image: initial;\">\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Trung tâm thương mại, dịch vụ và chăm sóc sức khỏe 3 Sơn</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Hai trường mẫu giáo Little Maple và Blossoms</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Trạm cung ứng nhiên liệu và dịch vụ Sông Hồng</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Trường tiểu học và trung học Đoàn thị Điểm</span></li>\r\n	<li style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khu vui chơi ngoài trời&nbsp;</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: i