eight: 1em; width: 585px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"7\" id=\"panel-12-4-0-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-editor so-widget-sow-editor-base\" style=\"box-sizing: inherit;\">\r\n<div class=\"siteorigin-widget-tinymce textwidget\" style=\"box-sizing: inherit;\">\r\n<h2 style=\"line-height: 1.1; box-sizing: inherit; clear: both; font-family: inherit; color: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt; color: rgb(0, 128, 0);\"><strong style=\"box-sizing: inherit;\">Nhà Phố Thương Mại</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Dãy&nbsp;nhà&nbsp;phố thương mại Gamuda&nbsp;này nằm ngay tại cổng vào của Gamuda Gardens với các dịch vụ tiện lợi nhất cho người dân như khu văn phòng, ngân hàng, siêu thị, cửa hàng ăn uống , chăm sóc sắc đẹp…</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-4-1\" style=\"box-sizing: border-box; min-height: 1em; width: 585px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-image panel-first-child panel-last-child\" data-index=\"8\" id=\"panel-12-4-1-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-image so-widget-sow-image-default-3f547a15eaaa\" style=\"box-sizing: inherit;\">\r\n<div class=\"sow-image-container\" style=\"box-sizing: inherit;\"><img alt=\"nha-pho-shop-house-gamuda\" class=\"so-widget-image\" height=\"506\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/04/nha-pho-shop-house-gamuda-1.jpg\" srcset=\"http://gamudagardens.vn/wp-content/uploads/2016/04/nha-pho-shop-house-gamuda-1.jpg 800w, http://gamudagardens.vn/wp-content/upl