: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Khu vui chơi ngoài trời&nbsp;</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\">&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"panel-grid\" id=\"pg-12-6\" style=\"box-sizing: inherit; zoom: 1; margin-right: -15px; margin-left: -15px; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; margin-top: 0px !important; margin-bottom: 30px !important;\">\r\n<div class=\"panel-grid-cell panel-grid-cell-empty\" id=\"pgc-12-6-0\" style=\"box-sizing: border-box; min-height: 1em; width: 35.625px; float: left; padding-left: 15px; padding-right: 15px;\">&nbsp;</div>\r\n\r\n<div class=\"panel-grid-cell\" id=\"pgc-12-6-1\" style=\"box-sizing: border-box; min-height: 1em; width: 1134.36px; float: left; padding-left: 15px; padding-right: 15px;\">\r\n<div class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"11\" id=\"panel-12-6-1-0\" style=\"box-sizing: inherit; margin: 0px; zoom: 1;\">\r\n<div class=\"so-widget-sow-editor so-widget-sow-editor-base\" style=\"box-sizing: inherit;\">\r\n<div class=\"siteorigin-widget-tinymce textwidget\" style=\"box-sizing: inherit;\">\r\n<h2 style=\"line-height: 1.1; box-sizing: inherit; clear: both; font-family: inherit; color: inherit;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\"><strong style=\"box-sizing: inherit;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-size: 12pt;\">Bản đồ Quy hoạch tiện ích Gamuda Gardens</span></strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em;\"><img alt=\"quy-hoach-tien-ich-khu-do-thi-gamuda-gardens\" class=\"alignnone size-full wp-image-1140\" height=\"648\" sizes=\"(max-width: 850px) 100vw, 850px\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/09/quy-hoach-tien-ich-khu-do-thi-gamuda-gardens.png\" srcset=\"http:/