(86, 'Biệt lập an toàn tuyệt đối', 'biet-lap-an-toan-tuyet-doi', '', 44, 'vietnamese', '[\"44\"]', '/uploads/images/bai-viet/service/n5.png', '\"\"', '<p>Với hơn 44 năm xây dựng, Traphaco đã kế thừa truyền thống và phát triển nền y học cổ truyền lên một tầm cao mới bằng công nghệ hiện đại, bằng tài trí của người Việt, gánh vác sứ mệnh phục vụ sức khỏe cộng đồng, vững bước tương lai trên “Con đường Sức khỏe Xanh”.</p>', '<p>Được thành lập từ năm 1996 với tiền thân là Trung tâm nội thất văn phòng, gia đình, trường học, sau hơn 20 năm hình thành và phát triển, công ty Ngọc Diệp đã trở thành một trong những Công ty hàng đầu về sản xuất và cung ứng các sản phẩm Nội thất</p>', 'Bewertung für Dr. Johann C. Römer', 'null', 'null', 0, 39, 1, 1, 1, 0, 0, 0, '', '', '', 3, 3, '2017-09-28 09:41:58', '2018-07-13 08:56:28'),
(87, 'Bảo hành sản phẩm trong vòng 30 ngày', 'bao-hanh-san-pham-trong-vong-30-ngay', '', 44, 'vietnamese', '[\"44\"]', '/uploads/images/bai-viet/service/n4.png', '\"\"', '<p>“Sức khỏe của mẹ và bé yêu vô cùng quan trọng trong suốt quá trình mang thai, sinh nở. Để bé phát triển toàn diện ngay từ khi còn trong bụng mẹ cho tới lúc chào đời, đồng thời, để thai phụ có thể vượt cạn an toàn thì một chế độ chăm sóc, nuôi dưỡng khoa học, có sự theo dõi, tư vấn và hỗ trợ của các chuyên gia, bác sỹ là rất cần thiết.”</p>', '<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 14pt;\"><strong style=\"box-sizing: inherit;\">Tổng quan về Shophouse Gamuda Garden</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Shophouse hay Nhà phố thương mại là mô hình kinh doanh được ưa chuộng ở các đô thị Châu Âu và Mỹ từ cách đây rất lâu, sau đó xuất hiện ở Châu Á và ngày càng được “trọng vọng” tại các thành phố lớn của Đông Nam Á.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><img alt=\"nha-pho-thuong-mai-shop-house\" class=\"alignnone size-full wp-image-740\" height=\"600\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/nha-pho-thuong-mai-shop-house.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><span style=\"box-sizing: inherit;\">Nắm bắt được xu hướng trên, Tập đoàn Gamuda đã mang dòng sản phẩm shop house vốn đã quen thuộc ở Malaysia đến Gamuda City. Nhà phố thương mại</span>&nbsp;<b>shophouse gamuda&nbsp;</b><span style=\"box-sizing: inherit;\">như một “sự nâng cấp” của nhà phố truyền thống với ưu điểm về quy hoạch, hạ tầng, giá trị thương mại và không gian chức năng hợp lý hơn. Hơn nữa, chức năng “kép” – vừa kinh doanh, vừa sinh hoạt thuận tiện “một bước ra phố” là ưu điểm nổi trội của loại hình bất động sản này. Nhờ đó, shophouse có giá trị thương mại cao mà vẫn phù hợp với tập quán sinh hoạt lâu đời cũng như mô hình kinh tế vừa và nhỏ của người Việt. Sự xuất hiện của Shophouse Gamuda sẽ trở thành sự lựa không thể bỏ qua cho các nhà kinh doanh năng động và thành đạt.</span></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><img alt=\"the-one-central-shophouse\" class=\"alignnone size-full wp-image-1283\" height=\"450\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/the-one-central-shophouse.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Các khu nhà phố xung quanh các tòa chung cư Gamuda The One Residence</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 14pt;\"><strong style=\"box-sizing: inherit;\">Vị Trí Nhà phố trong khu đô thị</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Các căn ShopHouse Gamuda nằm tại vị trí chiến lược trong Gamuda Gardens. Nằm ở vị trí đẹp nhất trong khu đô thị ( 3 cổng chính vào trong khu đô thị), xung quanh 3 khối nhà chung cư, trường học quốc tế, nhà câu lạc bộ. Dãy nhà phố số 3 đã hoàn thiện, các hộ gia đình đã dọn về ở và kinh doanh… Trong khi đó, The One Central, nơi giao thương sầm uất bao quanh tòa chung cư The One Residence với một mặt hướng ra đường Vành đai 3.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><img alt=\"vi-tri-shop-house-gamuda\" class=\"alignnone size-full wp-image-776\" height=\"444\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/vi-tri-shop-house-gamuda.png\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"595\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Các căn Shophouse ở vị trí rất đẹp</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><span style=\"box-sizing: inherit;\">Kinh doanh nơi đây bạn sẽ được phục vụ một lượng khách hàng đông đảo với gần 1.000 học sinh, giáo viên, hơn 600 căn hộ tại các khu The One Residence, The Three … Khu dân cư tại các biệt thự, liền kề</span><a href=\"http://kdtgamudacity.com/biet-thu-st3\">&nbsp;<strong>gamuda gardens</strong></a><b>&nbsp;</b><span style=\"box-sizing: inherit;\">lên tới hơn 15.000 cư dân sinh sống với mức thu nhập cao, đây quả là một thị trường lớn cho các hộ kinh doanh nơi đây</span></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">Khi sở hữu nhà phố thương mại tại Gamuda Gardens, khách hàng được quyền sở hữu vĩnh viễn căn nhà bao gồm hai chức năng: sinh hoạt gia đình và kinh doanh buôn bán, mở văn phòng,cho thuê…đặc biệt hơn nữa là thuế đất ở đây rẻ hơn ở các nơi khác do chủ đầu tư đã xây dựng các công trình cho thủ đô Hà Nội</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><img alt=\"nha-pho-shop-house-gamuda\" class=\"alignnone size-full wp-image-739\" height=\"506\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/08/nha-pho-shop-house-gamuda.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"800\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: center;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif;\">Dãy nhà Shophouse Gamuda</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><a href=\"http://gamudagardens.vn/nha-pho-gamuda-shophuse-gamuda/\" style=\"box-sizing: inherit; background-color: transparent; color: rgb(113, 193, 35); text-decoration-line: none; cursor: pointer; transition: all 0.3s ease-in-out;\">Shophouse Gamuda</a>&nbsp;<span style=\"box-sizing: inherit;\">mang đến cơ hội đầu tư “ Vàng” không thể bỏ lỡ cho các nhà đầu tư cũng như nơi khởi nghiệm lý tưởng cho các gia đình trẻ.</span></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">Ưu điểm của loại hình nhà phố thương mại</strong></span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">– Thiết kẻ phù hợp cho triển khai thương mại đa dạng: tự kinh doanh, cho thuê mặt bằng, vừa sinh sống vừa kinh doanh tại chỗ.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">– Khả năng sinh lời bền vững nhờ mặt tiền kinh doanh thuận lợi</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">– Có sẵn luồng giao thông nhộn nhịp của đường vành đai 3, đường Tam trinh</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">– Đón đầu tại “trung tâm mới” &nbsp;sầm uất bậc nhất thànhphố.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">– Số lượng giới hạn</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">– Phù hợp với mô hình kinh tế vừa và nhỏ của Việt Nam.</span></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; font-family: arial, helvetica, sans-serif; font-size: 12pt;\">– Bảo đảm tương lai bền vững nhờ thu nhập ổn định &amp; giá trị gia tăng theo thời gian</span></p>\r\n\r\n<h2 style=\"box-sizing: inherit; clear: both; font-family: Roboto, sans-serif; line-height: 1.1; color: rgb(0, 0, 0);\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">Thiết kế Shophouse</strong></span></h2>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><img alt=\"tien-ich-chung-cu-gamuda\" class=\"alignnone size-full wp-image-1558\" height=\"442\" src=\"http://gamudagardens.vn/wp-content/uploads/2016/05/tien-ich-chung-cu-gamuda.jpg\" style=\"box-sizing: inherit; border: 0px; height: auto; max-width: 100%;\" width=\"850\" /></p>\r\n\r\n<p style=\"box-sizing: inherit; margin-bottom: 1.5em; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\"><span style=\"box-sizing: inherit; color: rgb(0, 128, 0); font-family: arial, helvetica, sans-serif; font-size: 12pt;\"><strong style=\"box-sizing: inherit;\">Thông số kỹ thuật ShopHouse The 1 (Nhận nhà Qúy IV/2016)</strong></span></p>\r\n\r\n<div style=\"box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 16px;\">\r\n<ul 