(93, 'Hạ tầng tiện ích 5 sao', 'ha-tang-tien-ich-5-sao', '', 44, 'vietnamese', '[\"44\"]', '/uploads/images/bai-viet/service/n3.png', '\"\"', '<p>Với gần 200 tiện ích trải khắp dự án, và gần 40 tiện ích điểm nhấn tiêu chuẩn 5 sao, hạ tầng tiện ích chính là 1 yếu tố quan trọng Kiến tạo nên một đẳng cấp sống chuẩn thượng lưu của dự án.</p>', '<p>Với gần 200 tiện ích trải khắp dự án, và gần 40 tiện ích điểm nhấn tiêu chuẩn 5 sao, hạ tầng tiện ích chính là 1 yếu tố quan trọng Kiến tạo nên một đẳng cấp sống chuẩn thượng lưu của dự án. Với gần 200 tiện ích trải khắp dự án, và gần 40 tiện ích điểm nhấn tiêu chuẩn 5 sao, hạ tầng tiện ích chính là 1 yếu tố quan trọng Kiến tạo nên một đẳng cấp sống chuẩn thượng lưu của dự án. Với gần 200 tiện ích trải khắp dự án, và gần 40 tiện ích điểm nhấn tiêu chuẩn 5 sao, hạ tầng tiện ích chính là 1 yếu tố quan trọng Kiến tạo nên một đẳng cấp sống chuẩn thượng lưu của dự án.</p>\r\n\r\n<p>&nbsp;</p>', '', '', '', 0, 0, 1, -1, 0, -1, -1, 1, '', '', '', 3, 3, '2018-07-11 10:47:10', '2018-07-13 08:56:07'),
(94, 'Sở hữu vị trí đắc địa', 'so-huu-vi-tri-dac-dia', '', 44, 'vietnamese', '[\"44\"]', '/uploads/images/bai-viet/service/n15.png', '\"\"', '<p>Không chỉ sở hữu thế \"Vượng tài - đắc lộc\" trong phong thủy, từ đây cư dân có thể kết nối tới mọi cụm công trình nổi bật và những tuyến đường huyết mạch của thành phố trong vài phút.</p>', '<p>Không chỉ sở hữu thế \"Vượng tài - đắc lộc\" trong phong thủy, từ đây cư dân có thể kết nối tới mọi cụm công trình nổi bật và những tuyến đường huyết mạch của thành phố trong vài phút Không chỉ sở hữu thế \"Vượng tài - đắc lộc\" trong phong thủy, từ đây cư dân có thể kết nối tới mọi cụm công trình nổi bật và những tuyến đường huyết mạch của thành phố trong vài phút Không chỉ sở hữu thế \"Vượng tài - đắc lộc\" trong phong thủy, từ đây cư dân có thể kết nối tới mọi cụm công trình nổi bật và những tuyến đường huyết mạch của thành phố trong vài phút</p>', '', '', '', 0, 0, 1, -1, 0, -1, -1, 1, '', '', '', 3, 3, '2018-07-11 10:48:24', '2018-07-13 08:56:00'),
(95, 'Đẳng cấp hàng đầu Việt Nam', 'dang-cap-hang-dau-viet-nam', '', 44, 'vietnamese', '[\"44\"]', '/uploads/images/bai-viet/service/n14.png', '\"\"', '<p>Năm 2015 Vinhomes Riverside đã lọt Top 3 khu đô thị đáng sống nhất Việt Nam, đây là minh chứng rõ nét nhất về đẳng cấp và vị thế của dự án trong thị trường biệt thự cao cấp tại Việt Nam.</p>', '<p>Năm 2015 Vinhomes Riverside đã lọt Top 3 khu đô thị đáng sống nhất Việt Nam, đây là minh chứng rõ nét nhất về đẳng cấp và vị thế của dự án trong thị trường biệt thự cao cấp tại Việt Nam.</p>', '', '', '', 0, 0, 1, -1, 0, -1, -1, 1, '', '', '', 3, 3, '2018-07-11 10:49:02', '2018-07-13 08:55:54');
