(14, 'Vị trí dự án', 'vi-tri-du-an', '', 0, 'vietnamese', 2, 3, 1, 0, '/uploads/images/vi-tri-vinhomes-riverside-the-harmony.jpg', '\"\"', '<p>Chỉ cách trung tâm hồ Hoàn Kiếm chưa đầy 6km, Vinhomes Riverside – The Harmony, nằm tại cửa ngõ giao thương nhộn nhịp phía Đông Bắc của thủ đô Hà nội, sở hữu vị trí thuận tiện, di chuyển nhanh chóng vào tất cả các khu vực trung tâm qua cầu Vĩnh Tuy và Chương Dương, đồng thời liên kết thuận tiện tới các tỉnh thành trọng yếu.</p>', 0, 1, 0, 0, 0, 0, 0, '', '', '', 1, 3, '2017-01-17 14:49:47', '2018-07-10 16:28:50'),
(15, 'Quy trình sản xuất', 'quy-trinh-san-xuat', 'quy-trinh-san-xuat', 0, 'vietnamese', 4, 5, 1, 0, '/uploads/images/banner-2.jpg', '[{\"images\":\"\",\"title\":\"\",\"description\":\"\"}]', '', 0, 1, 0, 0, 0, -1, 1, '', '', '', 1, 1, '2017-01-17 14:50:24', '2017-08-06 21:24:24'),
