":\"\",\"images_8\":\"\",\"images_9\":\"\"}]', '', '', '', '[{\"shop\":\"0\",\"inner\":\"\",\"outner\":\"\"}]', 0.1, '', 6267, 8090, 449000, 199000, '<ul>\r\n	<li><strong>CHẤT LIỆU CHẮC CHẮN:</strong>&nbsp;Dây dạng dù bọc nhựa dẻo TPE&nbsp;cao cấp&nbsp;thoả mái xô bồ, không lo xoắn dây&nbsp;</li>\r\n	<li><strong>SỬ DỤNG ĐƠN GIẢN:</strong>&nbsp;Sạc pin/truyền dữ liệu nhanh chóng, nhỏ gọn tiện lợi</li>\r\n	<li><strong>MÀU SẮC ẤN TƯỢNG</strong>: Dây hồng</li>\r\n	<li><strong>THIẾT KẾ TIỆN LỢI:</strong>&nbsp;3 in 1 với đầu&nbsp;Lightning -&nbsp;Micro USB -&nbsp;Type-C</li>\r\n	<li><b>CÁP SẠC&nbsp;DÀNH CHO: </b>Hầu hết các thiết bị</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '', '<p><strong>Cáp Sạc Dù Kaku 3 in 1</strong> là&nbsp;sản phẩm đột phá về công nghệ. Với cáp 3 đầu thông minh bạn không còn phải mang theo 3 bộ sạc để sạc cho 3 thiết bị, giải phóng không gian cho giỏ đồ của bạn.<br />\r\n<strong>- Cáp sạc 3 đầu &nbsp;gồm:</strong><br />\r\n+ 1 đầu sạc Lightning cho thiết bị iPhone<br />\r\n+ 1 đầu sạc Micro USB cho các thiết bị Android.<br />\r\n+ 1 đầu sạc Type-C cho Macbook, Letv, Huawei, Xiaomi</p>\r\n\r\n<p>Chưa hết, sản phẩm được làm từ hợp kim nhôm sáng và bền bỉ, đánh bóng tỉ mỉ, đạt mức độ hoàn thiện cao, mang tới hiệu quả thẩm mỹ lớn cho sản phẩm. Đặc biệt, kết hợp nhôm sáng ở đầu cắm và dây dù bọc bọc nhựa dẻo TPE đã giúp tăng tính bền của sản phẩm, kéo dài thời gian sử dụng.</p>\r\n\r\n<p><strong>Thiết kế nhỏ gọn, tiện dụng</strong><br />\r\nDây cáp sạc 3 trong 1 Kaku có chiều dài 1m được thiết kế một chấu giữ nằm ở giữa cố định dây để tiện lợi hơn cho người dùng trong quá trình sạc. Dây có bọc lớp vải dù phủ ngoài, bên trong là lớp nilong được bện cẩn thận nhằm tạo độ bền và bảo vệ cho lõi cáp không bị ảnh hưởng bởi các tác động bên ngoài.&nbsp;</p>\r\n\r\n<p><strong>Tốc độ truyền điện cực tốt</strong><br />\r\nLõi cáp được sử dụng chất liệu đồng cao cấp có khả năng chịu được cường độ dòng điện tối đa lên đến 2.1A do đó đảm bảo tốc độ sạc điện ổn định, nhanh chóng. Giờ đây, bạn có thể thoải mái cắm 3 thiết bị điện thoại với 3 giao diện kết nối khác nhau cũng không phải lo cáp sạc cồng kềnh như trước nữa khi đã có cáp dù Kaku 3 trong 1.</p>\r\n\r\n<p><strong>Độ an toàn cao</strong><br />\r\nNhiều người lo ngại độ an toàn của sản phẩm khi sử dụng 3 cáp sạc liền một lúc có thể sẽ bị quá tải. Tuy nhiên với dây cáp sạc đa năng 3 trong 1 Kaku bạn có thể hoàn toàn yên tâm về vấn đề này bởi sản phẩm này đã được tích hợp IC thông minh không những hỗ trợ quá trình sạc mà còn có tác dụng kiểm soát dòng điện xấu vào máy, bảo vệ quá áp, quá nhiệt, quá dòng bảo vệ tốt nhất cho thiết bị người dùng.</p>\r\n\r\n<p><strong>Đặc điểm:</strong><br />\r\n- Có thể sạc cùng lúc 3 thiết bị<br />\r\n- Dây cáp bọc dù chống rối, chống gãy<br />\r\n- Đầu cáp bọc nhôm chắc chắn chống bể.<br />\r\n- Sản Phẩm chính hãng bảo hành 12 tháng.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', '', 0, 192, 1, '0000-00-00 00:00:00', 0, 1, 1, 1, 0, 0, 0, 0, 'vietnamese', 'CÁP SẠC DÂY DÙ KAKU 3 IN 1 LIGHTNING - MICRO USB - TYPE C', 'Cáp sạc 3 in 1 ', 'Cáp sạc dây dù Kaku dài 1M - cổng Lightning - Micro USB - Type C. Bạn đang sở hữu một chiếc iPhone, iPad hiện đại và sành điệu? ...  Chiều dài dây: 1m Điện áp: DC 5V-2.4A Chất liệu: hợp kim aluminum, đồng, nyl', 9, 3, '2019-02-20 11:14:13', '2019-08-19 21:38:54', 199000, 320000, 0, 320000, 0, 50),
