(3, 'products', 12, 6, 'Các bé trai thường thích độc lập và làm việc riêng của mình hơn các bé gái. Với các bé ở lứa tuổi mới chập chững biết nhận thức thì mỗi ngày là một cuộc phiêu lưu đầy thú vị. Ngoài việc học tập ở trường lớp thì bé rất thích tò mò và khám phá những điều mới lạ trong cuộc sống xung quanh mình. Với vai trò là cha mẹ, những người có thể tác động và hỗ trợ tốt nhất cho sự phát triển của bé, tạo ra một thế giới đầy sự bất ngờ, khơi dậy trí tưởng tượng và sáng tạo của bé là điều rất cần thiết. Chính vì thế các cha mẹ hãy cùng YAMADA KIDS dành cho con một không gian riêng với chủ đề Ô tô đang được các bé trai yêu thích nhất hiện nay. Hãy cùng chúng tôi khám phá xem set phòng này có những điều thú vị gì nhé.', 1, 0, '2018-08-15 11:10:36', '0000-00-00 00:00:00', 0);
