('contact_contact', '<p><font color=\"#ff0000\"><span style=\"font-size: 20px;\"><b>0941.555.666&nbsp;</b></span></font></p>\r\n\r\n<p><font color=\"#ff0000\"><span style=\"font-size: 20px;\"><b>Vando.vn&nbsp;</b></span></font></p>\r\n', '', 1, 4, '2017-01-09 08:52:19', '2019-08-20 21:51:21'),
('common_support', 'Công ty cổ phần Vando Việt Nam ', '', 1, 3, '2017-01-09 08:52:19', '2019-08-19 18:50:49'),
('common_skype_1', '<p>Phân tích ưu điểm về vị trí, tiện ích, mặt bằng tổng thể. Giỏ hàng từ chủ đầu tư, báo giá chi tiết, vị trí, phương thức thanh toán, layout căn hộ.<br />\r\n<strong>Tài liệu bao gồm:</strong><br />\r\n– Thông tin vị trí, tiện ích nội khu<br />\r\n– Mặt bằng tổng thể dự án<br />\r\n– Giá bán chi tiết, phương thức thanh toán các căn hộ từ chủ đầu tư<br />\r\n– Mặt bằng tầng, layout căn hộ</p>\r\n', '', 1, 3, '2017-01-09 08:52:19', '2018-07-13 10:23:17'),
('common_skype_2', '<p style=\"text-align: center;\">Một trong những lý do Vinhomes Riverside - The Harmony được giới thượng lưu lựa chọn là nhờ hệ thống các tiện ích cảnh quan đẳng cấp mà cư dân được đặc quyền sử dụng.Khu đô thị bao gồm các tiện ích đẳng cấp 5 sao đáp ứng đầy đủ nhu cầu mua sắm, vui chơi, giải trí, ẩm thực đến chăm sóc sức khỏe, y tế và giáo dục . Hơn thế nữa, hệ sinh thái tiện ích này lại nằm trọn trong không gian thiên nhiên trong lành và riêng biệt, khiến cuộc sống của cư dân nơi thực sự là một trải nghiệm sống “nghỉ dưỡng” hoàn hảo mỗi ngày</p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/uploads/images/maps.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><u><strong>Danh sách tiện ích</strong></u></p>\r\n\r\n<ol>\r\n	<li>Tiểu cảnh lối vào công viên</li>\r\n	<li>Sân tập Golf</li>\r\n	<li>Khu thể thao</li>\r\n	<li>Sân chơi liên hoàn cho trẻ con</li>\r\n	<li>Tiểu cảnh</li>\r\n	<li>Công viên thám hiểm</li>\r\n	<li>Chòi BBQ</li>\r\n	<li>Đường dạo ven kênh</li>\r\n	<li>Bến thuyền</li>\r\n	<li>Vườn dưỡng sinh</li>\r\n	<li>Sân trượt ván</li>\r\n	<li>Quảng trường trung tâm hướng hồ</li>\r\n	<li>Vườn mê cung</li>\r\n	<li>Nhà gỗ cho trẻ</li>\r\n	<li>Công viên thú cưng</li>\r\n	<li>Lối vào chính</li>\r\n	<li>Đảo đọc sách</li>\r\n	<li>Đường thể thao ven hồ</li>\r\n	<li>Vườn điêu khắc tượng</li>\r\n	<li>Đường dạo ven hồ</li>\r\n	<li>Vườn cờ</li>\r\n	<li>Nhà hàng nổi</li>\r\n	<li>Bãi cỏ đa năng</li>\r\n	<li>Sân tập thể thao ngoài trời</li>\r\n	<li>Đài phun nước, điểm ngắm cảnh</li>\r\n	<li>Bãi đỗ xe</li>\r\n	<li>Sân chơi nước tương tác</li>\r\n	<li>Vườn phong cách Châu Âu</li>\r\n	<li>Chòi nghỉ chân ngắm hồ</li>\r\n	<li>Đường dạo lát gỗ và nhà hàng ven hồ</li>\r\n	<li>Nhà CLB khu Hy Lạp</li>\r\n	<li>Bể bơi ngoài trời</li>\r\n	<li>Nhà CLB khu Pháp</li>\r\n	<li>Salon chăm sóc xe hơi</li>\r\n	<li>Trường Mầm non Vinschool</li>\r\n	<li>Trường THCS Vinschool</li>\r\n	<li>Trường THPT Vinschool</li>\r\n</ol>\r\n', '', 1, 3, '2017-01-09 08:52:19', '2018-07-13 10:23:17'),
