('address_address_1', '<p>Lần 1: Đặt cọc và ký TTĐC thanh toán 500 triệu / căn.</p>\r\n\r\n<p>Lần 2: Ngay khi ký HĐMB trong vòng 10 ngày đặt cọc thanh toán 15% giá trị BT(gồm VAT) đã gồm khoản đặt cọc</p>\r\n\r\n<p>Lần 3: Ngày 20/10/2017 thanh toán 15% giá trị BT (gồm VAT)</p>\r\n\r\n<p>Lần 4: Ngày 20/12/2017 thanh toán 20% giá BT (gồm VAT)</p>\r\n\r\n<p>Lần 5: Ngày 20/03/2018 thanh toán 10% giá BT (gồm VAT)</p>\r\n\r\n<p>Lần 6: Ngày 20/06/2018 thanh toán 10% giá BT (gồm VAT)</p>\r\n\r\n<p>Lần 7: Theo thông báo nhận bàn giao nhà (dự kiến tháng 8 - tháng 10 năm 2018) thanh toán 25% giá BT (gồm VAT) + VAT của 5% giá BT (của lần 9)</p>\r\n\r\n<p>Lần 8: Khi nhận sổ đỏ thanh toán 5% giá BT chưa gồm VAT</p>\r\n', '', 3, 3, '2017-09-30 15:22:15', '2018-07-13 10:23:17'),
('address_address_2', '<p>Tặng xe Mec hoặc trừ vào giá 1.43 tỷ</p>\r\n\r\n<p>Ưu đãi khi mua gói phí dịch vụ 10 năm với giá 1tr/m2 đất/10 năm (Chưa VAT)</p>\r\n\r\n<p>Tặng Voucher SPA 30tr tại Almaz</p>\r\n\r\n<p>Cho vay đến 65% GTBT với lãi suất 0% đến 19/02/2019 (Khu không hồ) hoặc đến 25/01/2019 với khu có hồ</p>\r\n\r\n<p>Hoặc không nhận các Quà tặng, ưu đãi trên và được Vay ngân hàng đến 65% GTBT với Lãi Suất 0% đến 24 tháng đối với khu không hồ 18 tháng đối với khu có hồ</p>\r\n', '', 3, 3, '2017-09-30 15:22:15', '2018-07-13 10:23:17'),
