INSERT INTO `teachers` (`id`, `title`, `chucvu`, `facebook`, `messenger`, `video`, `description`, `images`, `slug`, `canonical`, `created`, `updated`, `userid_created`, `userid_updated`, `trash`, `publish`, `highlight`) VALUES
(1, 'Vera Hà Anh', 'Chuyên gia tâm lý, Tổng Giám Đốc Công ty Tư Vấn Tâm Lý và Đào Tạo VERA ', '', '', '<iframe class=\"embed-responsive-item img-responsive\" src=\"https://www.youtube.com/embed/Ye0HYpWANjs?rel=0&amp;showinfo=0\" scrolling=\"no\" allowfullscreen=\"\" width=\"100%\" height=\"auto\" frameborder=\"0\"></iframe>', '<p class=\"chucvu\">Chuyên gia tâm lý, Tổng Giám Đốc Công ty Tư Vấn Tâm Lý và Đào Tạo VERA</p>\r\n\r\n<p>Chuyên tư vấn tình yêu cho các bạn trẻ, tư vấn hôn nhân, gia đình, giúp các bạn trẻ luôn có cuộc sống hạnh phúc, thành công.</p>\r\n\r\n<p>Tổng Giám Đốc Công ty Tư Vấn Tâm Lý và Đào Tạo VERA.</p>\r\n\r\n<p>Năm 2013 Cô được hiệp hội doanh nghiệp Việt Nam trao tặng danh hiệu “ NỮ DOANH NHÂN TÂM TÀI”</p>\r\n\r\n<p>Năm 2014 Cô đạt danh hiệu “DOANH NHÂN VĂN HÓA - NỮ TƯỚNG THỜI BÌNH”\'</p>\r\n\r\n<p>Với gần 10 NĂM kết hôn, đúc rút từ TRẢI NGHIỆM bản thân và những lần TRỊ LIỆU. Kiến thức đó đã giúp cho hàng nghìn người thay đổi tư duy và họ đã có một cuộc sống trở nên vô cùng tốt đẹp</p>', '/uploads/images/teachers/vera-ha-anh.jpg', 'vera-ha-anh', '', '2018-08-01 10:53:52', '2018-08-08 15:48:25', 3, 3, 0, 1, 0),
(2, 'Th.s Ruby Thảo Trần', '', '', '', '', '<p class=\"chucvu\">Thạc sỹ Tiếng anh</p>\r\n\r\n<p>Nhận bằng thạc sỹ Lý Luận và phương pháp giảng dạy tiếng Anh của Southern Queensland Australia University</p>\r\n\r\n<p>Cô có trên 7 năm kinh nghiệm giảng dạy tại các ngôi trường danh tiếng như New York center, Úc châu, Âu Mỹ, Úc Anh.</p>\r\n\r\n<p>Đồng thời cô cũng là người thành lập ra cơ sở học ngoại ngữ tại nhà KungFu English - Ruby\'s House với hơn 31 khóa học và hơn 3000 học viên đã tham gia học tính đến thời điểm hiện tại.</p>\r\n\r\n<p>Giúp cho rất nhiều các bạn học viên sở hữu điểm cao trong các kỳ thi Anh văn TOEIC, TOEFL, IELTS… cũng như khả năng giao tiếp của những bạn đã được cô đào tạo cải thiện tốt hơn trước rất nhiều.&nbsp;</p>', '/uploads/images/teachers/ruby-thao-tran.jpg', 'th-s-ruby-thao-tran', '', '2018-08-01 11:12:09', '2018-08-01 11:12:30', 3, 3, 0, 1, 0),
(3, 'Bùi Quang Cường', '', '', '', '', '<p class=\"chucvu\">Founder &amp; CEO iViet Solution, Giảng viên Marketing tại Đại học FPT</p>\r\n\r\n<p>Founder &amp; CEO iViet Solution</p>\r\n\r\n<p>Giảng viên marketing tại Đại học FPT, Hiệp hội internet Việt Nam &amp; Hội Truyền thông Số Việt Nam</p>\r\n\r\n<p>Thành viên tham gia chương trình xúc tiến thương mại Việt Nam, Hoa Kỳ năm 2017 và làm việc trực tiếp với Google tại Thung lũng Silicon, Mỹ.</p>\r\n\r\n<p>Khách mời - Doanh nhân: Chương trình CEO – Chìa khoá thành công VTV1</p>\r\n\r\n<p>Trên 9 năm kinh nghiệm ngành Marketing, truyền thông với nhiều dự án lớn trong lĩnh vực bất động sản, ô tô, giáo dục...</p>\r\n\r\n<p>Đạt chứng nhân toàn cầu của Google về kỹ năng quảng cáo và đưa iViet thành đối tác có huy hiệu của Google&nbsp;</p>', '/uploads/images/teachers/bui-quang-cuong.jpg', 'bui-quang-cuong', '', '2018-08-01 11:13:22', '0000-00-00 00:00:00', 3, 0, 0, 1, 0),
(4, 'Th.s Bùi Đức Tiến', '', '', '', '', '<p class=\"chucvu\">Thạc sĩ Ngôn ngữ học</p>\r\n\r\n<p>Thạc sĩ Bùi Đức Tiến tốt nghiệp thạc sĩ Linguistics, Đại học Curtin. Ông hiện là giảng viên khoa tiếng Anh tại Đại học Sư phạm TP. HCM và là ủy viên Ban Chấp Hành Hội Nghiên cứu và Giảng dạy tiếng Anh TP. HCM.&nbsp;Ngoài ra, thầy còn là &nbsp;người sáng lập Anh Ngữ English Master Center</p>\r\n\r\n<p>KINH NGHIỆM GIẢNG DẠY:</p>\r\n\r\n<p>* Các môn tham gia giảng dạy ở khoa tiếng Anh ĐHSP TP. HCM: &nbsp;</p>\r\n\r\n<p>* Nghe, Nói, Đọc và Viết Tiếng Anh</p>\r\n\r\n<p>* Ngôn ngữ học ứng dụng.</p>\r\n\r\n<p>KINH NGHIỆM LÀM VIỆC</p>\r\n\r\n<p>* Đồng sáng lập diễn đàn sinhvienkhoaanh.net dành cho sinh viên khoa Anh trường Đại học Sư phạm TP. HCM. Mục tiêu: giúp các bạn sinh viên có một môi trường thiết thực để truyền đạt kinh nghiệm học tập.</p>\r\n\r\n<p>* Ủy viên Ban Chấp Hành &nbsp;Hội Nghiên cứu và Giảng dạy tiếng Anh TP. HCM</p>\r\n\r\n<p>THÀNH TỰU/DỰ ÁN:</p>\r\n\r\n<p>* IELTS 8.5 trong đó điểm môn Viết là 8.0</p>\r\n\r\n<p>* 2009, 2010, 2011: Nhận học bổng Lawrence S. Ting dành cho sinh viên xuất sắc nhất các trường đại học &amp; Học bổng của Hội khuyến học Thành phố Hồ Chí Minh&nbsp;</p>\r\n\r\n<p>* 2008: Giải 3 kì thi học sinh giỏi cấp quốc gia môn tiếng Anh dành cho học sinh lớp 12</p>', '/uploads/images/teachers/bui-duc-tien.jpg', 'th-s-bui-duc-tien', '', '2018-08-01 11:14:30', '0000-00-00 00:00:00', 3, 0, 0, 1, 0),
(5, 'Bùi Trong Luân', 'Chuyên gia tâm lý, Tổng Giám Đốc Công ty Tư Vấn Tâm Lý và Đào Tạo VERA ', '', '', '<iframe class=\"embed-responsive-item img-responsive\" src=\"https://www.youtube.com/embed/Ye0HYpWANjs?rel=0&amp;showinfo=0\" scrolling=\"no\" allowfullscreen=\"\" width=\"100%\" height=\"auto\" frameborder=\"0\"></iframe>', '<p class=\"chucvu\">Chuyên gia tâm lý, Tổng Giám Đốc Công ty Tư Vấn Tâm Lý và Đào Tạo VERA</p>\r\n\r\n<p>Chuyên tư vấn tình yêu cho các bạn trẻ, tư vấn hôn nhân, gia đình, giúp các bạn trẻ luôn có cuộc sống hạnh phúc, thành công.</p>\r\n\r\n<p>Tổng Giám Đốc Công ty Tư Vấn Tâm Lý và Đào Tạo VERA.</p>\r\n\r\n<p>Năm 2013 Cô được hiệp hội doanh nghiệp Việt Nam trao tặng danh hiệu “ NỮ DOANH NHÂN TÂM TÀI”</p>\r\n\r\n<p>Năm 2014 Cô đạt danh hiệu “DOANH NHÂN VĂN HÓA - NỮ TƯỚNG THỜI BÌNH”\'</p>\r\n\r\n<p>Với gần 10 NĂM kết hôn, đúc rút từ TRẢI NGHIỆM bản thân và những lần TRỊ LIỆU. Kiến thức đó đã giúp cho hàng nghìn người thay đổi tư duy và họ đã có một cuộc sống trở nên vô cùng tốt đẹp</p>', '/uploads/images/teachers/vera-ha-anh.jpg', 'bui-trong-luan', '', '2018-08-16 10:53:52', '2018-08-23 15:48:25', 3, 3, 0, 1, 0);
