(5, 'Nhà hàng Gà Da Đen 47 Lò Đúc kính chào quý khách', 'nha-hang-ga-da-den-47-lo-duc-kinh-chao-quy-khach', 'nha-hang-ga-da-den-47-lo-duc-kinh-chao-quy-khach', 6, '[\"6\"]', 9, '/uploads/images/video/video-images-st4.jpg', 'vietnamese', 'https://www.youtube.com/watch?v=EFKxP-k7iMw', '/uploads/media/chet-cuoi-voi-man-nhin-khau-hinh-doan-tu-ngu(1).mp4', '<p>Tàu hũ ky hay còn gọi là phù trúc hoặc váng đậu là một sản phẩm làm từ đậu nành. Trong quá trình nấu đậu, một lớp đậu mỏng chứa đạm và chất béo sẽ hình thành trên bề mặt nồi sữa đậu. Người ta sẽ vớt lớp màng mỏng này và phơi khô để thành tàu hũ ky. Tàu hũ ky là sản phẩm được làm từ đậu nành nguyên chất, không hóa chất, không phẩm màu, không chất bảo quản. Trong quá trình nấu đậu, một lớp đậu mỏng chứa đạm và chất béo sẽ hình thành trên bề mặt nồi sữa đậu. Người thợ sẽ vớt lớp màng mỏng này và phơi khô để thành tàu hũ ky. Được chế biến qua nhiều giai đoạn công phu, đòi hỏi sự kiên trì và khéo léo của người sản xuất để cho ra những loại sản phẩm phong phú: tàu hũ ky cọng – lá, khô – tươi, tàu hũ ky đông lạnh.</p>\r\n', 1, 11, 1, 0, 0, 0, 0, 0, '', '', '', 1, 3, '2017-06-22 10:50:39', '2018-06-16 16:05:08'),
